import React, { useContext, useState } from "react";
import "./Header.css";
import logo from "../../assets/logo.jpeg";
import Button from "@material-ui/core/Button";
import { AuthContext } from "../../contexts/AuthContext";
import { useLogout } from "../hooks/useLogout";
import Modal from "react-modal";
import { Paper } from "@material-ui/core";
import { CardContent } from "@material-ui/core";
import { Tabs } from "@material-ui/core";
import { Tab } from "@material-ui/core";
import ModalStyle from "../styles/ModalStyle";
import TabPanel from "../tabs/TabPanel";

Modal.setAppElement(document.getElementById("root"));

const Header = () => {
  const { userToken, dispatch } = useContext(AuthContext);
  const [open, setOpen] = useState(false);
  const [value, setValue] = useState(0);

  const { logout } = useLogout();

  const handleLogout = async () => {
    sessionStorage.removeItem("access-token");
    sessionStorage.removeItem("emailId");
    sessionStorage.removeItem("appointmentId");
    sessionStorage.removeItem("doctorId");
    logout();
    dispatch({ type: "LOGOUT" });
  };

  const handleClose = () => {
    setOpen(false);
  };
  const handleOpen = () => {
    setOpen(true);
    //TODO: pending to do do dispatch login
  };

  function a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      "aria-controls": `simple-tabpanel-${index}`,
    };
  }

  return (
    <div>
      <header className="header">
        <img src={logo} alt="Bookmyconsultation Logo" />
        <span id="header-title">Doctor Finder</span>
        {!userToken || open ? (
          <div className="login-button">
            <Button variant="contained" color="primary" onClick={handleOpen}>
              Login
            </Button>
          </div>
        ) : (
          <div className="logout-button">
            <Button
              variant="contained"
              color="secondary"
              onClick={handleLogout}
            >
              Logout
            </Button>
          </div>
        )}
      </header>
      <Modal isOpen={open} onRequestClose={handleClose} style={ModalStyle}>
        <Paper className={props.paper}>
          <div className="typography">
            <p>Authentication</p>
          </div>
          <CardContent>
            <Tabs
              aria-label="Login and Register"
              value={value}
              centered
              TabIndicatorProps={{ style: { background: "#F50057" } }}
            >
              <Tab label="Login" {...a11yProps(0)}></Tab>
              <Tab label="Register" {...a11yProps(1)}></Tab>
            </Tabs>
            <TabPanel value={value} index={0}></TabPanel>
            <TabPanel value={value} index={1}></TabPanel>
          </CardContent>
        </Paper>
      </Modal>
    </div>
  );
};

export default Header;
